function App() {

  const [post,setPost] = useState("");
  useEffect(()=>{
    fetch(" https://jsonplaceholder.typicode.com/posts")
    .then(res=>res.json())
    .then(json=>setPost(json));

  },[])
  return (
    <Router>
    <div className="App">
      <Switch>
        </Switch>
      </div>
    </Router>
  );
}


export default App;
